% Tabletouse = spotsqpetrTable092;

% Give this whatever speed or x displacement information are looking at,
% currently built to look at a column vector that is in the same order as
% your angle vector. 
Speeddata = sortedtrack(:,35,73);
% Speeddata = Tabletouse.('SPEED');
%Histogram the mean x-displacment and attempts to fit to a double guassian,
%assuming smaller curve is nonmigratory cells
%Sets border between migratory and nonmigratory cells at 2 SDs above mean
%of smaller curve
h= histogram(Speeddata,'BinWidth',0.3,'Normalization','pdf','DisplayStyle','stairs'); %[output:63f1542f]
counts = h.Values;
binEdges = h.BinEdges;
clf %[output:4f834ae2]
binCenters = binEdges(1:end-1) + diff(binEdges)/2;
[fitresult,gof] = fit(binCenters',counts','gauss2')%,'StartPoint',[0.5,3,1,0.1,15,3],'Lower',[0,0.1,0,0.05,1,0]) %[output:6ecdd6d3] %[output:307a2377]
hold on %[output:4f834ae2]
plot(fitresult,binCenters,counts) %[output:4f834ae2]
xline(fitresult.b1+fitresult.c1) %[output:4f834ae2]
hold off %[output:4f834ae2]
clf
Speedborder = fitresult.b1+2*fitresult.c1 %[output:291bdde7]
%%

%Filter based on defined border
Selectedcells = sortedtrack(:,30,73)>= Speedborder;
Selectedcells = logical(Selectedcells.*~isnan(sortedtrack(:,1,73)));
Selectedcells = logical(Selectedcells.*~isnan(sortedtrack(:,10,73)));
Selectedcells = logical(Selectedcells.*~isnan(sortedtrack(:,20,73)));

% Selectedcells = Tabletouse.("SPEED")>=Speedborder;
% Selectedcells = Selectedcells.*Tabletouse.("FRAME")==30;
%The selected cells value will give you a logical vector that indicates yes
%or no if a given cell is migrating


%%
predrugmig = (sortedtrack(:,35,73)>3.84);

subplot(1,3,2) %[output:8a1faefa]
pax = polarhistogram(deg2rad(sortedtrack(logical(predrugmig.*(~isnan(sortedtrack(:,40,73)))),40,5)),18,'DisplayStyle','bar','FaceColor','White','FaceAlpha',1,'Normalization','percentage','LineWidth',2); %[output:8a1faefa]
pax = gca;
pax.ThetaLim = [-90,90]; %[output:8a1faefa]
pax.RLim = [0,radius]; %[output:8a1faefa]
title("2 hours after") %[output:8a1faefa]
% CellNum = sum(Selectedcells)

subplot(1,3,1) %[output:8a1faefa]
pax = polarhistogram(deg2rad(sortedtrack((predrugmig),35,5)),18,'DisplayStyle','bar','FaceColor','White','FaceAlpha',1,'Normalization','percentage','LineWidth',2); %[output:8a1faefa]
pax = gca;
pax.ThetaLim = [-90,90]; %[output:8a1faefa]
pax.RLim = [0,radius]; %[output:8a1faefa]
title("Pre drug addition") %[output:8a1faefa]
